    return (
        <div>
            <NavBar></NavBar>

            <div className="center-button" onClick={() => setPortfolio(true)}>
                <button>Get your portfolio</button>
            </div>

            {portfolio !== false ? <div>
                <h1>Here is your portfolio which protects the environment</h1>

                <div className="result">

                </div>    
                </div> : <div></div>
            }
        </div>
    );
}

export default Showcase;
